import './Search.css'

const Search = () => {

    
  function test() {
    console.log("test");
  }

  return (
    <div class='search'>
      
      <div class="input-div">

        <input

          class='input-field'
          type = "text"
          placeholder="Search for a category"

        />
        <label class='search-label' onClick={test}><i class="fa fa-arrow-right" aria-hidden="true"></i></label>

        <div class="result-window">
            
        </div>

      </div>

    </div>
  )
}

export default Search
